import styled from 'styled-components'
import img from "../images/1.png"

const DetailFeedScreenRelatedVideo = () => {
  return (
    <Main>
        <div className="Img">
            <img src={img}/>
        </div>
        <div>
                <p>Indian Bla i hate you</p>
          <p>13m views . 2 days ago</p>
          <div className="subcribe">
          <Img2>
            <img src={img} />
          </Img2>
          <div>
            <span>Cricket Tv AC</span>
          </div>
        </div>
        </div>
    </Main>
  )
}

export default DetailFeedScreenRelatedVideo

const Main = styled.div`
height: 30vh;
background-color: blue;
width: 100%;
margin-bottom: 20px;

display: flex;
align-items: center;
justify-content: center;
.Img {
    width: 50%;
    height: 25vh;
    overflow: hidden;
    
    img{
        object-fit: contain;
    }
}
`

const Img = styled.div`
  width: 100%;
  overflow: hidden;
  height: 60vh;
  display: grid;
  place-items: center;
  position: relative;
  img {
    width: 100%;
  }
  .subcribe {
      display: flex;
      align-items: center;
  }
`;
const Img2 = styled.div`
  width: fit-content;
  height: 10vh;

  img {
    width: 50px;
    height: 50px;
    border-radius: 50%;
  }
`
